import {makeStyles} from '@material-ui/core/styles';

export const useStyles = makeStyles(() => ({
    root: {
        '& h1.title': {
            paddingLeft: '7px',
            fontWeight: '400'
        },
        '& div.slider': {
            marginTop: '15px',
            '& div.slick-slide': {
                padding: '14px 7px',
                marginTop: '-14px'
            }
        },
    }
}));
